import React, { useState } from "react";
import Sidebar from "./Sidebar";
import "./Sidebar.css"; // Ensure Sidebar.css is in the same f
import "./Dashboard.css";
import DataUpload from "./DataUpload";
import PreviewAndProfiling from "./PreviewAndProfiling";
import RedundancyCleaning from "./RedundancyCleaning";
import OutlierDetection from "./OutlierDetection";
import DataStandardization from "./DataStandardization";
import DataTransformation from "./DataTransformation";
import CollaborativeCleaning from "./CollaborativeCleaning";
import ExportOptions from "./ExportOptions";
import ProfilePage from "./ProfilePage";
import Logout from "./Logout";

const Dashboard = () => {
  const [selectedFunctionality, setSelectedFunctionality] = useState(null);

  const functionalities = [
    "Data Upload",
    "Preview and Profiling",
    "Redundancy and Consistency Cleaning",
    "Outlier Detection",
    "Data Standardization",
    "Data Transformation",
    "Collaborative Cleaning",
    "Export Options",
    "Profile", 
    "Logout"
  ];

  const handleFunctionalityClick = (name) => {
    console.log("Selected functionality:", name); // Debug
    setSelectedFunctionality(name);
  };

  return (
    <div className="dashboard-container">
      <Sidebar
        functionalities={functionalities}
        onFunctionalityClick={handleFunctionalityClick}
      />
      <div className="main-content">
        <br/><br/><br/><br/>
        {selectedFunctionality === "Data Upload" && <DataUpload />}<br/>
        {selectedFunctionality === "Preview and Profiling" && <PreviewAndProfiling />}
        {selectedFunctionality === "Redundancy and Consistency Cleaning" && <RedundancyCleaning />}
        {selectedFunctionality === "Outlier Detection" && <OutlierDetection />}
        {selectedFunctionality === "Data Standardization" && <DataStandardization />}
        {selectedFunctionality === "Data Transformation" && <DataTransformation />}
        {selectedFunctionality === "Collaborative Cleaning" && <CollaborativeCleaning />}
        {selectedFunctionality === "Export Options" && <ExportOptions />}
        {selectedFunctionality === "Profile" && <ProfilePage />}
        {selectedFunctionality === "Logout" && <Logout />}
      </div>
    </div>
  );
};

export default Dashboard;
